import React from 'react'

import { Department } from '../index'
import { g1, g2, g3, g4, g5, g6, g7, g8 } from '../department/imports'

import './medals.css'

const departmentData = [
  {
    departmentImage: g1,
    departmentKey: 'G1',
    departmentName: 'Statistika'
  },
  {
    departmentImage: g2,
    departmentKey: 'G2',
    departmentName: 'Geofisika dan Meteorologi'
  },
  {
    departmentImage: g3,
    departmentKey: 'G3',
    departmentName: 'Biologi'
  },
  {
    departmentImage: g4,
    departmentKey: 'G4',
    departmentName: 'Kimia'
  },
  {
    departmentImage: g5,
    departmentKey: 'G5',
    departmentName: 'Matematika'
  },
  {
    departmentImage: g6,
    departmentKey: 'G6',
    departmentName: 'Ilmu Komputer'
  },
  {
    departmentImage: g7,
    departmentKey: 'G7',
    departmentName: 'Fisika'
  },
  {
    departmentImage: g8,
    departmentKey: 'G8',
    departmentName: 'Biokimia'
  },
]

const Medals = () => {
  return (
    <div>
      {departmentData.map((item, index) => (
          <Department departmentImage={item.departmentImage} departmentKey={item.departmentKey} departmentName={item.departmentName} key={item.departmentImage + index} />
        ))}
    </div>
  )
}

export default Medals
